  /**
   * Extracts the SVG from the DOM with CSS included. Used during exporting/saving a view as a SVG
   * @param {HTMLElement} svgNode - HTML element in document such as document.getElementById('network') or document.getElementById('tidytree')
   * @returns {string} String of SVG code for the element with CSS ie. <svg ...>
   */
  unparseSVG(svgNode) {
    svgNode.setAttribute("xlink", "http://www.w3.org/1999/xlink");
    let selectorTextArr = [];
    // Add Parent element Id and Classes to the list
    selectorTextArr.push("#" + svgNode.id);
    let nClasses = svgNode.classList.length;
    for (let c = 0; c < nClasses; c++) {
      if (!ngx_bootstrap_utils__WEBPACK_IMPORTED_MODULE_11__.window.context.commonService.includes("." + svgNode.classList[c], selectorTextArr)) {
        selectorTextArr.push("." + svgNode.classList[c]);
      }
    }
    // Add Children element Ids and Classes to the list
    let nodes = svgNode.getElementsByTagName("*");
    let nNodes = nodes.length;
    for (let i = 0; i < nNodes; i++) {
      let id = nodes[i]._id;
      if (!ngx_bootstrap_utils__WEBPACK_IMPORTED_MODULE_11__.window.context.commonService.includes("#" + id, selectorTextArr)) {
        selectorTextArr.push("#" + id);
      }
      let classes = nodes[i].classList;
      for (let d = 0; d < classes.length; d++) {
        if (!ngx_bootstrap_utils__WEBPACK_IMPORTED_MODULE_11__.window.context.commonService.includes("." + classes[d], selectorTextArr)) {
          selectorTextArr.push("." + classes[d]);
        }
      }
    }
    // Extract CSS Rules
    let extractedCSSText = "";
    let nStylesheets = document.styleSheets.length;
    for (let j = 0; j < nStylesheets; j++) {
      let s = document.styleSheets[j];
      try {
        if (!s.cssRules) continue;
      } catch (e) {
        if (e.name !== "SecurityError") throw e; // for Firefox
        continue;
      }
      let cssRules = s.cssRules;
      let nRules = cssRules.length;
      for (let r = 0; r < nRules; r++) {
        let rule = cssRules[r];
        if (!rule.selectorText) continue;
        if (rule.selectorText.includes(selectorTextArr)) {
          extractedCSSText += rule.cssText;
        }
      }
    }
    let styleElement = document.createElement("style");
    styleElement.setAttribute("type", "text/css");
    styleElement.innerHTML = extractedCSSText;
    let refNode = svgNode.hasChildNodes() ? svgNode.children[0] : null;
    svgNode.insertBefore(styleElement, refNode);
    let serializer = new XMLSerializer();
    return serializer.serializeToString(svgNode);
  }
